@-moz-document domain("vozforums.com") {
body {
    color: #c9c9c9;
    background-color: #000;
    background-image: url(data:image/png;base64,) !important;
}
.page,
.alt1,
.alt1Active,
.alt2,
.alt2Active,
#f213,
#f47,
#f222,
#f212,
#f224,
.alt1Active_brother {
    background-color: #262626;
}
.tborder {
    background-color: #4e4c4c;
}
.tcat {
    background: none;
}
.thead,
.vbmenu_control {
    background: #3a3a3a;
}
a:link,
a:visited,
body_alink,
.alt1,
.alt1Active,
.alt2,
.alt2Active,
.tborder,
.page,
.panel,
select,
.button,
.voz-post-message font {
    color: #c9c9c9 !important;
}
#threadslist a:visited {
    color: #737373 !important;
}
.panel,
.panelsurround {
    border: 0;
    background: #262626;
}
.vBulletin_editor,
select, .button {
    background: #262626;
}
#vB_Editor_QR_textarea, #vB_Editor_001_textarea {
    background: transparent;
    color: #c9c9c9;
}
.tborder, select, .button {
    border-color: #4e4c4c;
}
.page {
	min-width: 0;
    width: 100% !important;
}
}
